                    while sa_uri in parent_cdef.sequenceAnnotations:
                        sa_instance += 1
                        sa_uri = '%s/%s_%d/%s' %(parent_cdef.persistentIdentity, sa_id, sa_instance, cdef.version)
                    sa = parent_cdef.sequenceAnnotations.create('%s_%d' %(sa_id, sa_instance))
                    sa.component = c
